INSERT INTO `BOOK_INFO` (`Book_ID`, `Bookname`, `Price`, `Stock`, `Image`, `Abstract`, `Author`, `Publisher`, `ISBN`, `Classification_ID`) VALUES
(1000000, 'Artificial Intelligence', 64.99, 999, 'https://i.imgur.com/a1XhFHy.jpg', 'Artificial intelligence: A Modern Approach, 3rd edition, by Russell is ideal for one or two-semester, undergraduate or graduate-level courses in Artificial Intelligence. Artificial intelligence: A Modern Approach 3rd edition is also a valuable resource for computer professionals, linguists, and cognitive scientists interested in artificial intelligence. The revision of this best-selling text offers the most comprehensive, up-to-date introduction to the theory and practice of artificial intelligence.', 'Stuart Russell and Peter Norvig', 'Prentice Hall', '136042597', 1),
(1000001, 'Java How To Program', 74.99, 999, 'https://i.imgur.com/xNIP1do.jpg', 'The Deitels groundbreaking How to Program series offers unparalleled breadth and depth of object-oriented programming concepts and intermediate-level topics for further study. Java How to Program (Early Objects), Tenth Edition, teaches programming by presenting the concepts in the context of full working programs and takes an early-objects approach.', 'Paul Deitel and Harvey Deitel', 'Pearson Education', '1292018194', 2),
(1000002, 'Starting Out with Python', 56.23, 999, 'https://i.imgur.com/MwUia7z.jpg', 'In Starting Out with Python, Second Edition Tony Gaddis\' evenly-paced, accessible coverage introduces students to the basics of programming and prepares them to transition into more complicated languages. Python, an easy-to-learn and increasingly popular object-oriented language, allows readers to become comfortable with the fundamentals of programming without the troublesome syntax that can be challenging for novices. With the knowledge acquired using Python, students gain confidence in their skills and learn to recognize the logic behind developing high-quality programs.', 'Tony Gaddis', 'University,TAFE', '9780132576376', 3),
(1000003, 'Starting Out with C++', 89.99, 999, 'https://i.imgur.com/PZYiFBf.png', 'This text is intended for either a one-semester accelerated introductory course or a traditional two-semester sequence covering C++ programming. It is also suitable for readers interested in a comprehensive introduction to C++ programming. Tony Gaddis\'s accessible, step-by-step presentation helps beginning students understand the important details necessary to become skilled programmers at an introductory level. Gaddis motivates the study of both programming skills and the C++ programming language by presenting all the details needed to understand the how and the why but never losing sight of the fact that most beginners struggle with this material. His approach is both gradual and highly accessible, ensuring that students understand the logic behind developing high-quality programs.', 'Tony Gaddis', '', '133769399', 4),
(1000004, 'Android How to Program', 49.99, 999, 'https://i.imgur.com/zuM1uFp.jpg', 'Android How to Program, Second Edition provides a clear and entertaining App-driven introduction to Android 4.3 and 4.4 development for both introductory- and intermediate-level programming courses. It also serves as a great reference and tutorial to learn Android programming.', 'Paul Deitel and Harvey Deitel', 'Prentice Hall', '133764036', 5),
(1000005, 'IOS 9 Swift Programming Cookbook', 80.18, 999, 'https://i.imgur.com/NAk1tO6.jpg', 'Ready to build stunning apps for iPhone, iPad, and Apple Watch? This cookbook-completely rewritten with all-new material-provides 90 proven solutions for tackling the latest features in iOS 9 and watchOS 2.0. Written exclusively in Apple\'s Swift language, these code-rich recipes show you how to use dynamic user interfaces, interactive maps, multitasking functionality, Apple\'s new UI Testing framework, and many other features. This cookbook is ideal for intermediate and advanced iOS developers looking to work with the newest versions of Apple\'s mobile operating systems. Each recipe includes reusable code, available on GitHub, that you can put to work right away. Work with new features in Swift 2, Xcode 7, and Interface Builder Build standalone apps for Apple Watch Create vibrant user interfaces with new UIKit features Use Swift to connect with the iOS contacts database Block ads or obtrusive content with Safari Content Blockers Make your app content searchable with Spotlight APIs Add Picture in Picture playback functionality to iPad apps Take advantage of MapKit and Core Location updates Use Apple\'s new UI Testing framework Liven up your UI with gravity and turbulence fields.', 'Nahavandipoor, Vandad', 'O\'Reilly Media', '9781491936696', 6);

